- input: "TEXT\x1CC00001305\x1C.TEXT\x1C\x1CF3XA\x1CResponse to FEC Letter of Jan.
    29, 2013 requesting additional information for the September Monthly Report (08/01/2012
    - 08/31/2012)                                                Item 1 - Funds received
    from the Republican National Committee and the National Republican Senatorial
    Committee include a letter stating that none of the funds transferred were earmarked
    for any particular program or purpose.  The Schedule B Line 30(B) disbursements
    listed on this Letter represent volunteer activity that meets the definition of
    Exempt Party Activity as set forth in 11CFR100.87 and 100.147.  Payments for these
    disbursements were made from permissable Federal funds, and did not include any
    designated candidate funds.                                                           Item
    2 - Could not find a disbursement to \"Petty cash\" for \"Per diem expense\" on
    the Report.  The only disbursements for \"Per diem expense\" were made to Sean
    Storan on 8/23 for $500, and on 8/28 for $750.  These totals represented $50 per
    day stipend for meals and gas expense.\n"
